import React from "react";
import ReactDom from "react-dom";

ReactDom.render(
  // React.fragment is a replacement of div in version 16or above
  <React.Fragment>
    <h1>Netflix Best Series </h1>
    <ol>
      <li>Stranger Things</li>
      <li>Sex Education</li>
      <li>Whitcher</li>
      <li>Dark</li>
      <li>Sacred Games</li>
    </ol>
  </React.Fragment>,
  document.getElementById("root")
);
